import React, { Component } from 'react'
import 'bootstrap/dist/css/bootstrap.css'
import Style from './index.css'

export default class MyNavItem extends Component {
  render() {
    const {iconData, key} = this.props;
    console.log(this.props)
    return (
      <div className='col-lg-1' key={key}>
        <img className='' src={iconData.iconPath} title={iconData.title} alt={iconData.alt} />
      </div>
    )
  }
}
